import React from "react";
import Input from "../components/Input";
import useAuth from "../hooks/useAuth";

function IndexPage() {
  console.log(useAuth);
  return (
    <>
      <Input variant="light" size="sm" type="text" />
      <Input variant="dark" size="mid" type="password" />
      <Input variant="light" size="lg" type="email" />
      <Input variant="light" size="xl" type="search" />
      <Input variant="light" size="xxl" type="password" />
    </>
  );
}

export default IndexPage;
